import React from "react";
import everest from "../img/everest.png";

function Card(props) {
  console.log(props);
  return (
    <div className="card">
      <img className="card-image" src={everest} />
      <span className="card-location">
        <h3> Nepal </h3>
        <h5> View on Google Maps </h5>
      </span>
      <div className="card-stats">
        <h1> Mount Fuji </h1>
        <h4> 12 Jan, 2023 - 24 Jan, 2021 </h4>
        <p>
          "Mount Everest is Earth's highest mountain above sea level, located in
          the Mahalangur Himal sub-range of the Himalayas", img: everest,
        </p>
      </div>
    </div>
  );
}

export default Card;
